import React from 'react';
import styled from 'styled-components';

const WelcomeContainer = styled.div`
  height: 100vh; /* Set the height to cover the viewport */
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #f9f9f9; /* Set the background color */
`;

const WelcomeMessage = styled.h1`
  font-size: 3rem;
  color: #333;
`;

const WelcomingPage = ({ selectedFaculty, setSelectedFaculty }) => {
  return (
    <>
      <WelcomeContainer>
        <WelcomeMessage>Welcome to My Website</WelcomeMessage>
      </WelcomeContainer>
      <FacultyButtons selectedFaculty={selectedFaculty} setSelectedFaculty={setSelectedFaculty} />
    </>
  );
};


export default WelcomingPage;
